import React from 'react'
import Topbar from '../components/topbar/Topbar'
import Footer from '../components/footer/Footer'
import styled from 'styled-components'

const Container = styled.div`
  margin-top: 120px;
`
const BoxShad = styled.div`
  flex: 2;
  width: auto;
  height: auto;
  border-radius: 100px 0px 100px 0px;
  margin-top: 160px;
  margin-bottom: 20px;
  -webkit-box-shadow: 2px 10px 29px -4px rgba(150,110,57,0.67);
  -moz-box-shadow: 2px 10px 29px -4px rgba(150,110,57,0.67);
  box-shadow: 2px 10px 29px -4px rgba(150,110,57,0.67);
`
const TextBox = styled.div`
  color: #4d4d4d;
  font-weight: 300;
  margin: 20px;
`
const ImageTop = styled.img`
  margin-left: 20px;
  flex: 2;
  padding: 10px;
  border-radius: 500px 120px 500px 120px;
  width: 250px;
  height: 600px;
  object-fit: cover;
`

const ImageFooter = styled.img`
  margin-left: 20px;
  flex: 2;
  padding: 10px;
  border-radius: 500px 120px 500px 120px;
  width: 250px;
  height: 600px;
  object-fit: cover;
`

const GridTop = styled.div`
  display: flex;
  flex-wrap: wrap;
  flex-direction: initial;
  margin: 20px;
`
const Title = styled.h3`
  color: #966D39;
  font-weight: 400px;
  font-family: 'Reenie Beanie', cursive;
  font-size: 30px;
`
const Spn = styled.span`
  color: #966D39;
  font-family: 'Reenie Beanie', cursive;
  font-weight: 400px;
  font-size: 26px;
`
const Info = () => {
  return (
    <>
      <Topbar />
        <Container className='container-sm' >
          <center><br />
            <div >
              <Title>Antonia Andreazza Clínica Estética: </Title><Spn>Renovando sua beleza a cada dia.</Spn>
            </div>
          </center>
          <GridTop>
            <BoxShad>
              <TextBox><br /> <br />
                <p>
                  <h4><center>Conheça a Nossa História e Compromisso</center></h4>
                  Bem-vindo(a) à Clínica de Estética Antonia Andreazza! Completando três anos de excelência em cuidados estéticos, nos 
                  orgulhamos de ser uma referência no setor de beleza e bem-estar. A clínica se destaca por oferecer serviços que vão além 
                  da superfície, promovendo a harmonia entre corpo, mente e alma.
                </p>
              </TextBox>
            </BoxShad>
            <ImageTop 
              src='https://firebasestorage.googleapis.com/v0/b/ecommerce-shop-82750.appspot.com/o/Screenshot%202023-08-16%20at%2018-47-24%20Cl%C3%ADnica%20Est%C3%A9tica%20Ros%C3%A1rio%20do%20Sul%20(%40esteticantoniandreazza)%20%E2%80%A2%20Instagram%20photos%20and%20videos.png?alt=media&token=db24955c-14f7-4fce-bf06-b36eaeb62757'
              alt='img founder'
              width=''
              height=''
            />
          </GridTop>
          <GridTop>
            <TextBox>
              <h4><center>Nossa História</center></h4>
              <p>
                Nossa jornada começou há 3 anos, quando a fundadora e proprietária, Antonia Andreazza, reconhecendo a necessidade de um espaço 
                que oferecesse tratamentos estéticos inovadores e personalizados, decidiu transformar sua paixão em uma realidade palpável. 
                Sua formação acadêmica sólida, aliada à sua visão empreendedora, possibilitou a criação da Clínica. Somando-se a isto determinada
                experiência, a mente por trás da Clínica é uma profissional altamente qualificada, com uma pós-graduação em Estética Clínica. 
                Com um compromisso inabalável com a atualização constante das práticas e tendências mais recentes,
                ofertando a todos os clientes tratamentos de última geração, com resultados visíveis e
                duradouros.

              </p>
            </TextBox>
          </GridTop>
          <GridTop>
            <ImageFooter 
              src='https://firebasestorage.googleapis.com/v0/b/ecommerce-shop-82750.appspot.com/o/Screenshot%202023-08-20%20at%2001-38-15%20Cl%C3%ADnica%20Est%C3%A9tica%20Ros%C3%A1rio%20do%20Sul%20(%40esteticantoniandreazza)%20%E2%80%A2%20Fotos%20e%20v%C3%ADdeos%20do%20Instagram.png?alt=media&token=cc536cf2-0f7f-44f4-b65c-d63c915e74a9
              '
              alt='img founder'
              width=''
              height=''
            />

            <BoxShad>
              <TextBox><br /> <br />
                <p>
                  <h4><center>Conheça a Nossa História e Compromisso</center></h4>
                  Bem-vindo(a) à Clínica de Estética Antonia Andreazza! Completando três anos de excelência em cuidados estéticos, nos 
                  orgulhamos de ser uma referência no setor de beleza e bem-estar. A clínica se destaca por oferecer serviços que vão além 
                  da superfície, promovendo a harmonia entre corpo, mente e alma.
                </p>
              </TextBox>
            </BoxShad>
          </GridTop>        
        </Container>

      <Footer />
  </>
  )
}

export default Info
